import React from "react";

const About = () => {
  return (
    <div>
      <div id="about" className="counter">
        <div className="container">
          <div className="row">
            <div className="col-lg-5 col-xl-6">
              <div className="image-container">
                <img
                  className="img-fluid"
                  src="assets/images/about.jpeg"
                  alt="alternative"
                />
              </div>{" "}
              {/* end of image-container */}
            </div>{" "}
            {/* end of col */}
            <div className="col-lg-7 col-xl-6">
              <div className="text-container">
                <div className="section-title">ABOUT BRAINBOXBD</div>
                <h2>We're Passionate About Delivering Growth Services</h2>
                <p>
                  tend to repeat predefined chunks as necessary, making this the
                  first true generator on the Internet. It uses a dictionary of
                  over 200 Latin words, combined with a handful of model
                  sentence structures, to generate Lorem Ipsum which looks
                  reasonable. The generated Lorem Ipsum is therefore always free
                  from repetition,
                </p>

                {/* end of counter */}
              </div>{" "}
              {/* end of text-container */}
            </div>{" "}
            {/* end of col */}
          </div>{" "}
          {/* end of row */}
        </div>{" "}
        {/* end of container */}
      </div>{" "}
      {/* end of counter */}
      {/* end of about */}
    </div>
  );
};

export default About;
